// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract PiggyBank {
    address public Owner;
    address public Sender;
    // value是在建立時存放進去多少錢
    event Create(address Owner, uint256 value);
    // Receive紀錄使用者存進來多少錢
    event Receive(address indexed sender, uint256 value);
    event Withdraw(address indexed Owner, uint256 indexed value);
    modifier OnlyOwner() {
        require(Owner == msg.sender, "Only owner can call this function.");
        _;
    }
    // 若想在建立合約時就想收到錢，就要寫constructor
    constructor() payable {
        Owner = msg.sender;
        emit Create(Owner, msg.value);
    }
    receive() payable external{
        Sender = msg.sender;
        emit Receive(Sender, msg.value);
    }
    // 合約內部不會要領錢，都是給外部的人呼叫，所以定義external
    function withdraw() OnlyOwner external {
        // 要把錢發到這個地址上，所以要加上payable的位置
        // msg.sender是一般的地址，要加上payable才可以把錢發進去
        address payable Receiver = payable(msg.sender);
        uint256 value = address(this).balance;
        // 若沒有要檢查send的回傳值，用transfer就好
        // transfer和send內都是放要轉入錢的數量
        Receiver.transfer(value);
        emit Withdraw(Receiver, value);
    }
}

